const gatherUtxoByCombinePsbt = async (value: number, address: string) => {
    const dave = ECPair.fromWIF(accounts.dave.privateKey, network)
    const emily = ECPair.fromWIF(accounts.emily.privateKey, network)

    const psbt = new Psbt({ network })

    psbt.addInput({
        hash: '04aad0000f33f396791322092b727f69cae3a204186dc70bef5e301306c1a3d5',
        index: 0,
        nonWitnessUtxo: Buffer.from('', 'hex')
    })

    psbt.addInput({
        hash: '1d2a046d55a30c4d4f59546b736ee7dbae33be1218cba4725714cf7d2a04d7ee',
        index: 544,
        nonWitnessUtxo: Buffer.from('', 'hex')
    })

    psbt.addOutput({
        address,
        value
    })

    const psbtBaseText = psbt.toBase64()

    // console.log({ psbtBaseText })

    const daveSigner = Psbt.fromBase64(psbtBaseText)
    const emilySigner = Psbt.fromBase64(psbtBaseText)

    daveSigner.signAllInputs(dave)
    emilySigner.signAllInputs(emily)

    const daveSignedText = daveSigner.toBase64()
    const emilySignedText = emilySigner.toBase64()

    console.log({ daveSignedText, emilySignedText })

    psbt.combine(Psbt.fromBase64(daveSignedText), Psbt.fromBase64(emilySignedText))

    for (let i = 0; i < psbt.inputCount; i++) console.log(`input ${i} valid ${psbt.validateSignaturesOfInput(i)}`)

    psbt.finalizeAllInputs()

    const raw_tx = psbt.extractTransaction(false).toHex()

    console.log({ raw_tx })
}

